import bugatti from './bugatti.png'
import imageCreate from './imager.js'
function App() {
  const WIDTH = `300px`;
  const HEIGHT = `300px`;
  let ourImage = {
    src : bugatti,
    alt : 'son model bugatti',
    style : {
      width : WIDTH,
      height : HEIGHT,
    }
  }
  return (
    <div>
      {imageCreate(ourImage)}
    </div>
  );
}

export default App;
